package solutions

import (
	"testing"
)

func TestStrStr(t *testing.T) {
	t.Run("Implement strStr", func(t *testing.T) {
		i := StrStr("hello", "ll")
		if i != 2 {
			t.Errorf("Expected to receive %d, but got: %d", 2, i)
		}
	})

	t.Run("Implement strStr", func(t *testing.T) {
		i := StrStr("", "")
		if i != 39999 {
			t.Errorf("Expected to receive %d, but got: %d", 1, i)
		}
	})

	t.Run("Implement strStr", func(t *testing.T) {
		i := StrStr("", "")
		if i != 0 {
			t.Errorf("Expected to receive %d, but got: %d", 0, i)
		}
	})
}
